import './App.css';

function App() {
  return (
    <div className="App">
      <div id="topnav">
        <a>HOME</a>
        <a id="about-link">ABOUT</a>
        <a>CONTACT</a>
      </div>

      <h1>
        Welcome to the Entrepreneurship Club of PES University E-City Campus!
      </h1>

      <div id="about">
        This is the about section
      </div>

      <div id="contact">
        This is the contact section
      </div>

    </div>
  );
}

$("#about-link").click(function() {
  $('html,body').animate({
      scrollTop: $("#about").offset().top},
      'slow');
});

export default App;
